$(document).ready(function () {

    var table=$('#users_table').DataTable( {
        paging: false,
        searching: true,
        dom: 'Bfrtip',
        buttons: [
            'copy', 'csv', 'excel', {
                extend: 'pdfHtml5',
                text: 'PDF',

                customize: function ( doc ) {


                    var logo="data:image/png;base64,";
                    doc.pageMargins = [20,60,20,30];

                    var name=sessionStorage.getItem("admin_email");

                    doc.defaultStyle.fontSize = 7;

                    doc.styles.tableHeader.fontSize = 7;

                    doc['header']=(function() {
                        return {
                            columns: [
                                {
                                    image: logo,
                                    width: 40
                                },
                                {
                                    alignment: 'left',
                                    italics: true,
                                    text: 'Jowath Events',
                                    fontSize: 18,
                                    margin: [10,0]
                                },
                                {
                                    alignment: 'centre',
                                    fontSize: 14,
                                    text: 'Client reports \n  Generated By :  ' +name
                                }
                            ],
                            margin: 20
                        }
                    });

                    var objLayout = {};
                    objLayout['hLineWidth'] = function(i) { return .5; };
                    objLayout['vLineWidth'] = function(i) { return .5; };
                    objLayout['hLineColor'] = function(i) { return '#aaa'; };
                    objLayout['vLineColor'] = function(i) { return '#aaa'; };
                    objLayout['paddingLeft'] = function(i) { return 4; };
                    objLayout['paddingRight'] = function(i) { return 4; };
                    doc.content[0].layout = objLayout;

                }
            },
            {
                extend: 'print',
                exportOptions: {
                    columns: ':visible'
                }
            },
            'colvis'
        ],
        "ajax": {
            "url": "http://localhost/Sheila/api/fetch_admin.php",
            "dataSrc": ""
        },
        "columns": [{
            "data" : "admin_id"
        }, {
            "data" : "admin_name"
        }, {
            "data" : "admin_email"
        }, {
                "targets": -1,
                "data": null,
                "defaultContent":
                    "<button onclick=\"javascript:callJavascriptFunction()\"" +
                    " type=\"button\" class=\"btn btn-outline-danger btn-sm user\" " +
                    "id='" + this.booking_id + "'>REMOVE</button>"
            } ,
        ]
    } );


    $('#users_table tbody').on( 'click', 'tr', function () {
        var tableData = $(this).children("td").map(function () {
            return $(this).text();
        }).get();

        swal({
            title: "Are you sure?",
            text: "Confirm to delete admin",
            icon: "warning",
            buttons: true,
            dangerMode: true,
        })
            .then((willDelete) => {
                if (willDelete) {
                    $.post('http://localhost/Sheila/api/delete_admin.php',{id:tableData[0]},function (data,status) {

                        swal("Deletion successfull");

                        location.reload();


                    })
                } else {

                }
            });



    } );


    fetch_users();

    function fetch_users(){

        var url = 'http://localhost/Sheila/api/fetch_users.php';

        $.get(url, function (response, status) {

            $parse=JSON.parse(response);

            $("#total_items").text($parse.length);


        });


    }


});